import React from "react";
import {Container , Button} from "react-bootstrap";
import {Link} from "react-router-dom";

function AfterLogout(){
    return(
        <Container>
            <Link>
                <Button size="lg" style={{backgroundColor : "white" , color : "black" , height : "40px" , borderRadius : "20px" , width : "80px"}}>
                    Please to continue
                </Button>
            </Link>
        </Container>
    )
}

export default AfterLogout
